Classical Mythology books

1. How Philosophers Saved Myths: Allegorical Interpretation and Classical Mythology - Luc Brisson

2. Everything Classical Mythology Book: Greek and Roman Gods, Goddesses, Heroes, and Monsters from Ares to Zeus - Lesley Bolton 

3. Earth's Daughters Stories of Women in Classical Mythology - Betty Lies

4. Classical Mythology A Very Short Introduction - Helen Morales

5. Who's Who in Classical Mythology, 3rd Edition - Michael Grant, John Hazel

6. A Short Guide to Classical Mythology - G.M. Kirkwood

7. Classical Mythology &amp; More: A Reader Workbook - Marianthe Colakis, Mary Joan Masello

8. Rewriting Classical Mythology in the Hispanic Baroque - Isabel Torres

9. The Complete Idiot's Guide to Classical Mythology, 2nd Edition (The Complete Idiot's Guide) - Kevin Osborn, Ph.D., Dana L. Burgess

10. Cassell dictionary of classical mythology - Jennifer R March 

11. Voyages in Classical Mythology - Mary Ellen Snodgrass 

12. Women of Classical Mythology: A Biographical Dictionary - Robert E. Bell

